Dani Jensen, Jenny Hendrix, Julia Ann, Krissy Lynn, Mckenzie Lee, Natasha Marley, Phoenix Marie, Sadie West, Jamey Slade, Madison Fox, Kerry Louise, India Summer, Rachel Roxxx, Jazy Berlin, Dylan Ryder, Celeste Star, Amber Rayne, Hannah West, Kaci Starr, Madelyn Marie, Riley Evans, Andy San Dimas

The iconic story gets updated by visionary director Nicholas Steele. Paul Chaplin and Natasha Marley play the deadly duo who cut a path of violence and eroticism through the American South. Their crimes made them famous. Their passion made them legends.
